import React, { Component } from 'react'
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
/*
export const Logout = () => {
  localStorage.clear();
  window.location.href = "/session";
}*/

class MainView extends Component {
  render() {
   
    return (
        <div className="a-mainview">
        
            <Link className="a-single-tab" to="/my">O meu jornal</Link>
          
            <Link className="a-single-tab" to="/news">Home </Link>
          
            <Link className="a-single-tab" to="/saved">Guardados</Link>
          
        <Switch>
            <Route path="/news" />
          
            <Route path="/my" />
           
            <Route path="/saved" />
        </Switch>
        </div>
    )
  }
}

export default MainView;
